import React, { useState } from 'react';

const LoginForm = () => {
  // ... (이전 코드를 그대로 사용)

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('http://localhost:3000/api/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          username,
          password,
        }),
      });

      if (response.ok) {
        setMessage('로그인 성공!');
        // Do something after successful login (e.g., redirect to a new page)
      } else {
        setMessage('로그인 실패. 올바른 정보를 입력하세요.');
      }
    } catch (error) {
      setMessage('로그인 실패. 서버 오류가 발생했습니다.');
    }
  };

  const handleSignupSubmit = async (e) => {
    e.preventDefault();

    const newUsername = document.getElementById('newUsername').value;
    const newPassword = document.getElementById('newPassword').value;
    const newTel = document.getElementById('newTel').value;
    const newEmail = document.getElementById('newEmail').value;

    try {
      const response = await fetch('/api/signup', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          username: newUsername,
          password: newPassword,
          tel: newTel,
          email: newEmail,
        }),
      });

      if (response.ok) {
        setMessage('회원가입 성공!');
        setShowSignupModal(false); // Close the signup modal after successful signup
      } else {
        setMessage('회원가입 실패. 서버 오류가 발생했습니다.');
      }
    } catch (error) {
      setMessage('회원가입 실패. 서버 오류가 발생했습니다.');
    }
  };

  return (
    <div className='loginpage'>
      <form onSubmit={handleSubmit}>
        <label htmlFor="username"><h3>사용자 이름</h3></label>
        <input
          type="text"
          id="username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          required
        />
        <label htmlFor="password"><h3>비밀번호</h3></label>
        <input
          type="password"
          id="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <button type="submit" className="login-button">로그인</button>
        <button type="button" className="signup-button" onClick={handleSignupModalOpen}>
          회원가입
        </button>
      </form>
      <p>{message}</p>

      {showSignupModal && ( // Conditionally render the signup modal
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={handleSignupModalClose}>
              &times;
            </span>
            <form onSubmit={handleSignupSubmit}>
              <h3>회원가입</h3>
              <label for="newUsername">아이디</label>
              <input type="text" id="newUsername" required />


              <label for="newPassword">비밀번호</label>
              <input type="text" id="newPassword" required />


              <label for="newTel">전화번호</label>
              <input type="text" id="newTel" required />

              <label for="newEmail">이메일</label>
              <input type="text" id="newEmail" required />

              <button type="submit" className="signup-button">회원가입</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default LoginForm;
